import {ApolloClient, InMemoryCache, createHttpLink} from 'apollo-boost';

const client = new ApolloClient({
    link: createHttpLink({
        uri: 'https://api.spacex.land/graphql/'

    }),
    cache: new InMemoryCache()
});

export default client;
